import React from 'react'
import IncomeTransaction from '../IncomeTransaction'
import ExpenseTransaction from '../ExpenseTransaction'

function TransHistory() {
  return (
    <>
    <div>TransHistory</div>
    <IncomeTransaction/>
    <ExpenseTransaction/>
    </>

  )
}

export default TransHistory
